import React from 'react';
import { useTable } from 'react-table';
import { Carousel, Products, Searcher } from "../../components";
import slides from "../../data/sliderData";
import productsData from '../../data/productsData';
import './Home.css';

const data = React.useMemo(
    () => [
      { contrato: '123', cliente: 'Cliente A', sucursal: 'Sucursal 1', identificador: 'ID-001' },
      { contrato: '124', cliente: 'Cliente B', sucursal: 'Sucursal 2', identificador: 'ID-002' },
      { contrato: '125', cliente: 'Cliente C', sucursal: 'Sucursal 3', identificador: 'ID-003' },
    ],
    []
  );
  const columns = React.useMemo(
    () => [
      { Header: 'Contrato', accessor: 'contrato' },
      { Header: 'Cliente', accessor: 'cliente' },
      { Header: 'Sucursal', accessor: 'sucursal' },
      { Header: 'Identificador', accessor: 'identificador' },
    ],
    []
  );

  const DynamicTable = () => {
    const {
      getTableProps,
      getTableBodyProps,
      headerGroups,
      rows,
      prepareRow,
    } = useTable({ columns, data });

    return (
      <table {...getTableProps()} className="table">
        <thead>
          {headerGroups.map(headerGroup => (
            <tr {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map(column => (
                <th {...column.getHeaderProps()}>{column.render('Header')}</th>
              ))}
            </tr>
          ))}
        </thead>
        <tbody {...getTableBodyProps()}>
          {rows.map(row => {
            prepareRow(row);
            return (
              <tr {...row.getRowProps()}>
                {row.cells.map(cell => (
                  <td {...cell.getCellProps()}>{cell.render('Cell')}</td>
                ))}
              </tr>
            );
          })}
        </tbody>
      </table>
    );
  };

  const Home = () => {
    return (
      <div className="home_container">
        <div className="home_header">
          <div className="table1_container"></div>
          <div className="data1_container"></div>
          <div className="data2_container">
            <div className="data2_colum"></div>
            <div className="data2_colum"></div>
            <div className="data2_colum"></div>
          </div>
        </div>
        <div className="table2_container">
          <DynamicTable />
        </div>
      </div>
    );
  };

  export default Home;
